				<input className="form-input" placeholder="Tên"></input>
				<input className="form-input" placeholder="Tuổi"></input>
				<input className="form-input" placeholder="Địa chỉ"></input>
				<input className="form-input" placeholder="Số điện thoại"></input>
			</div>
			<div c>
				<button>Add</button>
				<button>Close</button>
			</div>
		</div>
	);
};

export default AddCustomerForm;
